    [],nt"num_tags": 21,nt"name": "narrative-report-crescent-lake-national-wildlife-refuge-period-ending-april-30-1949",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1949. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and wildfires. Resource management is outlined; topics include grazing,
    haying, and fur harvesting. The public relations section of the report describes
    recreational uses, Refuge visitors, and violations. N-R forms are attached.",nt"owner_org":
